import React from 'react';
import s from './Home.module.css';

function Home() {
    return (
        <div className={s.home}>
            <div>
            <span className={s.Tigran}>
                Բարև ես Տիգրանեմ Խերանյանն եմ!
            </span>
            <span>
                ես սկսնակ frontend ծրագրավորող եմ, ծրագրավորմամբ զբաղվում եմ արդեն 1 տարի, և նպատակ ունեմ հասնել Մարս
            </span>
            <img src="https://instagram.fevn4-1.fna.fbcdn.net/v/t51.2885-15/sh0.08/e35/s640x640/186008107_139463368203309_3294694123125017533_n.jpg?tp=1&_nc_ht=instagram.fevn4-1.fna.fbcdn.net&_nc_cat=109&_nc_ohc=F9-G6MZcJccAX-Uw8Nt&edm=AP_V10EBAAAA&ccb=7-4&oh=491f429f1c1a030cb70857a60fb3926e&oe=60CCFDB8&_nc_sid=4f3" alt="" />
            </div>
        </div>
    );
}

export default Home;
